
$(function(){
    new htmlLoad().syncHtml();
    typeOfAgent();
    initHeight();
    initBanner().init();
    initHover();
    initAnimate();
    initStyle();
})

function initStyle() {
    globalObj.firstStyel = $("#removeStyle").html();
}

function initHover() {
    $("#prev").hover(function () {
        $("#prev marquee").css("visibility","visible");
        $("#prev div").css("visibility","hidden");
    },function () {
        $("#prev marquee").css("visibility","hidden");
        $("#prev div").css("visibility","visible");
    })
    $("#next").hover(function () {
        $("#next marquee").css("visibility","visible");
        $("#next div").css("visibility","hidden");
    },function () {
        $("#next marquee").css("visibility","hidden");
        $("#next div").css("visibility","visible");
    })
}

function initHeight() {
    $(".banner").css("height", window.innerHeight - 50);
    if(window.innerWidth < 1143) {
        $("body").css({"overflow":"unset","overflow-y":"hidden"})
    }
}

function initBanner() {

    var bannerDuty = ["#duty-scouts", "#duty-Sworder", "#duty-sniper", "#duty-magic", "#duty-heavyObj", "#duty-medic", "#duty-Delta", "#duty-assist"];
    globalObj.index = 0;
    globalObj.moveIndex = 0;
    var divObj;

    function init() {
        initMove();
        initClick();
    }

    function initMove(){
        $(".banner").css("visibility","visible");
        globalLock.bannerClickLock = true;
        engerMove();
    }

    function engerMove() {
        if(globalObj.moveIndex + 1 > 7) {
            globalObj.moveIndex ++ ;
            var $scouts = $("#duty-scouts");
            $scouts.addClass("extHover");
            $scouts.hover(function () {
                $("#duty-scouts").removeClass("extHover");
            });
            reloadDrag();
            globalLock.bannerClickLock = false;
            return;
        }
        globalObj.moveIndex ++ ;
        runleft("-s");// 谷歌浏览器延迟20ms可以处理，但是qq需要40ms以上
    }

    function initClick() {
        $("#next").click(function () {
            runright();
        });
        $("#prev").click(function () {
            runleft();
        });
        $("#introduction").click(function () {
            createCurtain("html/introduction.html");
        });
        $("#how2use").click(function () {
            createCurtain("html/how2use.html");
        });
    }

    function createCurtain(url) {
        var appendDiv = document.createElement("div");
        document.body.appendChild(appendDiv);
        importHtml(url, false, function (res) {
            $(appendDiv).html($(res));
        })
    }

    function reloadDrag() {
        var divList = document.getElementById('banner-list-longger').getElementsByTagName("div");
        // //点击某物体时，用drag对象即可，move和up是全局区域，
        // 也就是整个文档通用，应该使用document对象而不是drag对象(否则，采用drag对象时物体只能往右方或下方移动)
        for(var i = divList.length;i -- > 0;) {
            divObj = divList[i];
            divObj.removeEventListener("onmousedown",drag);
            divObj.onmousedown = drag;
        }
    }

    function drag(ev) {
        var event = event || window.event;  //兼容IE浏览器
        //    鼠标点击物体那一刻相对于物体左侧边框的距离=点击时的位置相对于浏览器最左边的距离-物体左边框相对于浏览器最左边的距离
        var diffX = ev.clientX;
        var diffY = ev.clientY;
        if (typeof divObj.setCapture !== 'undefined') {
            divObj.setCapture();
        }
        document.onmousemove = function (event) {
            var event = event || window.event;
            var moveX = event.clientX - diffX;
            var moveY = event.clientY - diffY;
            if (moveX > 0) {
                runright();
                document.onmousemove = null;
            } else if (moveX < 0) {
                runleft();
                document.onmousemove = null;
            } /*else {
                //document.onmousemove = null;// 如果只是设置时间的时候这个就有效，但是异步回调就反而破坏功能
            }*/
        }
        document.onmouseup = function (event) {
            document.onmousemove = null;
        }
    }

    function reloadClick() {
        $("#banner-list-longger div").each(function (index, value) {
            var $value = $(value);
            $value.unbind("click");
            $value.click(function () {
                window.location.href = "html/piiic.html?dutyId=" + $value.attr("id");
            })
        })
    }

    function runleft(str) {
        if(!globalLock.bannerClickLock || str) {
            if(!str) str = "";
            globalObj.index = globalObj.index % 8;
            globalLock.bannerClickLock = true;
            var newDiv = bannerDuty[(globalObj.index + 4) % 8];
            $("#banner-list-longger").append('<div class="banner-slide2" id="' + newDiv.replace("#","") + '"><img src="' + imageMap[newDiv] + '"></div>');

            $(bannerDuty[globalObj.index]).attr("class","banner-slide2" + str);
            $(bannerDuty[(globalObj.index + 1) % 8]).attr("class","banner-slide0-move" + str);
            // 有一个不用改
            $(bannerDuty[(globalObj.index + 3) % 8]).attr("class","banner-slide1" + str);
            $(newDiv).attr("class","banner-slide0-move" + str);

            setTimeout(function () {
                $(bannerDuty[globalObj.index]).remove();
                $(bannerDuty[(globalObj.index + 1) % 8]).attr("class","banner-slide0-nomove-d");
                globalObj.index ++;
                globalLock.bannerClickLock = false;
                reloadDrag();
                reloadClick();
                if(globalObj.moveIndex <= 7) {
                    setTimeout(function () {
                        engerMove();
                    }, 50);
                }
            },str ? 200 : 340);// 谷歌浏览器延迟20ms可以处理，但是qq需要40ms以上
        }
    }

    function runright() {
        if(!globalLock.bannerClickLock) {
            globalObj.index = globalObj.index % 8;
            globalLock.bannerClickLock = true;
            $(bannerDuty[globalObj.index]).attr("class","banner-slide0-nomove");
            $(bannerDuty[(globalObj.index + 1) % 8]).attr("class","banner-slide1-nomove");
            $(bannerDuty[(globalObj.index + 2) % 8]).attr("class","banner-slide1-nomove");
            $(bannerDuty[(globalObj.index + 3) % 8]).attr("class","banner-slide0-nomove");
            var newDiv = bannerDuty[(globalObj.index + 7) % 8];
            $("#banner-list-longger").prepend('<div class="banner-slide2" id="' + newDiv.replace("#","") + '"><img src="' + imageMap[newDiv] + '"></div>');

            setTimeout(function () {
                $(bannerDuty[(globalObj.index + 7) % 8]).attr("class", "banner-slide0-move-d");
                // 有一个不用改
                $(bannerDuty[globalObj.index]).attr("class", "banner-slide1");
                $(bannerDuty[(globalObj.index + 2) % 8]).attr("class", "banner-slide0-move");
                $(bannerDuty[(globalObj.index + 3) % 8]).attr("class", "banner-slide2");
            },20)
            setTimeout(function () {
                $(newDiv).attr("class", "banner-slide0-nomove-d");
                $(bannerDuty[(globalObj.index + 3) % 8]).remove();
                globalObj.index = (globalObj.index + 7) % 8;
                globalLock.bannerClickLock = false;
                reloadDrag();
                reloadClick();
            },340);
        }
    }

    var imageMap = {
        "#duty-scouts" : "data:image/png;base64,",
        "#duty-Sworder" : "data:image/png;base64,",
        "#duty-sniper" : "data:image/png;base64,",
        "#duty-magic" : "data:image/png;base64,",
        "#duty-heavyObj" : "data:image/png;base64,",
        "#duty-medic" : "data:image/png;base64,",
        "#duty-Delta" : "data:image/png;base64,",
        "#duty-assist" : "data:image/png;base64,",
    }

    return {
        init : init,
    }
}


function initAnimate() {
    $("#ci-particles").append('<div class="word glitch"><div class="flash is-off"> <span class="text">自助长图测评</span> </div></div>');
}


